If you are familiar with Rust, feel free to skip that section. Let's write some code. Our backend should be able to receive a username from program arguments, and print greeting with the username in it. Take a look at src/main.rs : ~/hello-world $ cat src/main.rs You will see the following code. It's there by default: fn main() { println!("Hello, world!");
} It almost does what we need, except for reading a username. So, open src/main.rs in your editor, delete all the code in there, and paste the following: use std::env; fn greeting(name: String) -> String { format!("Hello, world! From user {}", name)
} fn main() { let name = env::args().nth(1).unwrap(); println!("{}", greeting(name));
} What this code does: Defines a greeting function that takes a name, and returns a greeting message Defines a main function that reads first program argument, passes it to greeting , and prints the result Let's now compile and run our example: ~/hello-world $ cargo +nightly run myName Compiling hello-world v0.1.0 (/root/hello-world) Finished dev [unoptimized + debuginfo] target(s) in 0.70s Running `target/debug/hello-world myName`
